import React from 'react';
import Frame from './components/Frame';
import {Outlet,Link} from 'react-router-dom';

function App() {
    return (
        <Frame>
            <div>
                <Link to="/admin/dashboard/Index">看板</Link> |{" "}
                <Link to="/admin/products">商品</Link>
                <Link to="/admin/products/edit:id">编辑</Link>
            </div>
        </Frame>
    )
}

export default App
